import { IOutput } from "./Interface/IOutput"
import React, { FC, memo } from "react"

const OutputImpl: FC<IOutput> = ({ output }) => {
    return (<div className='output'>
            {output.map((element,i) => {
                return element.status === 1 ? <div key={i} className='error'>{element.line}</div> : <div key={i}>{element.line}</div>
            })}
        </div>)
}

export const Output = memo(OutputImpl)
